import axios from "axios";
import styles from "./Diets.module.css";

export default function Diets() {
  const dietas = [];
  axios
    .get("http://localhost:3001/diets")
    .then(({ data }) => (dietas = data.flatMap((element) => element.name)))
    .then(console.log(dietas));

  return <div className={styles.Contenedor}>{data}</div>;
}
